import React from 'react';
import styled from 'styled-components';
import MenuArea from '../menu/MenuArea';
import EnrollList from './EnrollList';

const EnrollSection = styled.div`
    background-color: #ccf;
    height: 100vh;
    display: flex;
    /* flex-direction: column; */
    justify-content: center;
    align-items: center;
`;

const EnrollMain = () => {
    return (
        <EnrollSection>
            <MenuArea />
            <EnrollList />
        </EnrollSection>
    );
};

export default EnrollMain;
